import styled from "styled-components"

export default function TelaLogin({ icon }) {
    return (
        <>

            <Icon>
                <img src={icon} alt="icon" />
            </Icon>
            <InputLogin>
                <input
                    type="text"
                    placeholder="E-mail"
                />
                <input
                    type="text"
                    placeholder="Senha"
                />
            </InputLogin>
            <Button>
                <p>Entrar</p>
            </Button>

            <Text>
                <p>Não possuí uma conta? Cadastre-se</p>
            </Text>
        </>
    )
}

const Icon = styled.div`
    display: flex;
    justify-content: center;
    padding: 134px 38px 0 38px;
    img{
        width: 299px;
        height: 49px;
    }
`
const InputLogin = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    margin-top: 100px;
    input{
        border-radius: 8px;
        width: 299px;
        height: 52px;
        background-color: #FFFFFF;
        margin-bottom: 16px;
        cursor: text;
}

`
const Button = styled.div`
    width: auto;
    display: flex;
    justify-content: center;
    align-items: center;
    color: #FFFFFF;

    & button{
        width: 299px;
        height: 52px;
        background-color: #FF4791;

        border-radius: 8px;
        cursor: pointer;
    }
`
const Text = styled.div`
margin-top: 24px;
    width: auto;
    display: flex;
    justify-content: center;
    align-items: center;
    color: #FFFFFF;
`
